Louis Malle's very different look at America.  Highly recommended viewing before thinking about emmigrating.  A rare look at Middle America where dishwashers don't have split level apartments in Manhattan.
There is a minute amount of French (Malle voiceover) but English subtitles are a bit redundant (and nonexistent on this version).

